import React from 'react';

const styles = {
  body: {
    fontFamily: 'Arial, sans-serif',
    backgroundColor: '#f0f0f0',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '100vh',
    margin: 0
  },
  container: {
    backgroundColor: '#fff',
    padding: '20px',
    borderRadius: '8px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    textAlign: 'center',
    width: '300px'
  },
  feedback: {
    marginBottom: '20px'
  },
  stars: {
    display: 'flex',
    flexDirection: 'column'
  },
  starContainer: {
    display: 'flex',
    marginBottom: '15px',
    position: 'relative'
  },
  star: {
    fontSize: '24px',
    color: '#ffd700' // gold color
  },
  percentageLine: {
    position: 'absolute',
    bottom: '-10px',
    height: '4px',
    backgroundColor: '#4caf50' // green color
  },
  p: {
    margin: '5px 0'
  }
};

const FeedbackRatings = () => {
  const feedbackData = [
    { stars: 5, percentage: 90 },
    { stars: 4, percentage: 30 },
    { stars: 3, percentage: 70 },
    { stars: 2, percentage: 5 },
    { stars: 1, percentage: 2 }
  ];

  return (
    <div style={styles.body}>
      <div style={styles.container}>
        <h1>Feedback Ratings Visualization</h1>
        <div style={styles.feedback}>
          <div style={styles.stars}>
            {feedbackData.map((item, index) => (
              <div key={index} style={styles.starContainer}>
                <span style={styles.star}>
                  {Array(item.stars)
                    .fill('★')
                    .join('')}
                </span>
                <div
                  style={{
                    ...styles.percentageLine,
                    width: `${item.percentage}%`
                  }}
                ></div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default FeedbackRatings;
